import React from 'react';
import "./Home.css";

const Home = () => {
  return (
    <div>
      <div className='headar'>
      <h1>Home Page</h1>
      </div>
      <nav>
        <button className='btn btn-1'>Home</button>
        <button className='btn btn-2'>Units</button>
      </nav>
    </div>
  )
};

export default Home;
